CREATE DATABASE IF NOT EXISTS fleetdb;

USE fleetdb;

CREATE TABLE IF NOT EXISTS events (
	eventid INT(50) NOT NULL AUTO_INCREMENT, 
	driverId VARCHAR(50) DEFAULT NULL, 
	truckId VARCHAR(50) DEFAULT NULL,
	eventType VARCHAR(100) DEFAULT NULL,
	longitude FLOAT DEFAULT NULL,
	latitude FLOAT DEFAULT NULL,
	routeName VARCHAR(500) DEFAULT NULL,
	eventts VARCHAR(40) DEFAULT NULL,
	miles VARCHAR(40) DEFAULT NULL,	
	PRIMARY KEY (eventid)
);

ALTER TABLE events AUTO_INCREMENT=10001;

CREATE TABLE if NOT EXISTS driver (driverid integer,name varchar(100),ssn integer, location varchar(200),certified char(1),wageplan varchar(100),updts timestamp);

CREATE TABLE IF NOT EXISTS timesheet (driverId int,week int,hourslogged int,mileslogged int); 

DELIMITER $$
CREATE PROCEDURE Getcurrentevent (IN seqno INT)
BEGIN
	SELECT * FROM events where eventid > ((seqno-1) * 7 ) + 10001 and eventid <= (seqno * 7) + 10001;
END $$ 
DELIMITER ;





TRUNCATE TABLE driver;

TRUNCATE TABLE timesheet;

